$Orange: hsl(26, 100%, 55%);
$PaleOrange: hsl(25, 100%, 94%);
$VeryDarkBlue: hsl(220, 13%, 13%);
$DarkGrayishBlue: hsl(219, 9%, 45%);
$GrayishBlue: hsl(220, 14%, 75%);
$LightGrayishBlue: hsl(223, 64%, 98%);
$White: white;
$Black: black;

@mixin flex-container($flexDirection: row, $justify: center, $align: center) {
    display: flex;
    justify-content: $justify;
    align-items: $align;
    flex-direction: $flexDirection;
}

@mixin btnMove {
    z-index: 20;
    width: 40px;
    height: 40px;
    border-radius: 50%;
    position: absolute;
    top: 50%;
    background-color: #f0f1f2;
}

@mixin heading-font() {
    font-weight: 700;
    font-size: 4.2rem;
    color: $VeryDarkBlue;
}

* {
    margin: 0;
    padding: 0;
    box-sizing: border-box;
    outline: none;
}

html {
    font-size: 62.5%;
}

body {
    font-family: "Kumbh Sans", sans-serif;
    font-weight: 400;
    line-height: 1;
    font-size: 1.6rem;
    min-height: 125;
    position: relative;
    z-index: -100;
}

///////////////////////HEADER///////////////////

header {
    padding-block: 3rem;
    padding-inline: 12rem;

    .container-header {
        display: flex;
        align-items: center;
        padding-bottom: 4rem;
        border-bottom: 1px solid #f0f1f2;

        .btn-mobile-nav {
            border: none;
            background: none;
            cursor: pointer;
            display: none;
            margin-top: 5px;
            margin-right: 2rem;

            .icon-mobile-nav[name="close"] {
                display: none;
            }
        }

        ///////////////////nav////////////
        nav {
            @include flex-container($justify: flex-start);
            gap: 4rem;
            flex: 1;

            .links {
                list-style: none;
                @include flex-container();
                gap: 3.5rem;

                .link {
                    .link-tag {
                        text-decoration: none;
                        position: relative;
                        color: $VeryDarkBlue;
                    }

                    .link-tag::after {
                        position: absolute;
                        content: "";
                        height: 2px;
                        bottom: -51px;
                        right: 0;
                        width: 100%;
                        background: $Orange;
                        visibility: hidden;
                        opacity: 0;
                        transition: visibility 0s, opacity 0.3s linear;
                    }

                    .link-tag:hover::after {
                        visibility: visible;
                        opacity: 1;
                    }
                }
            }
        }

        ////////////////////basket///////////////

        .basket {
            @include flex-container($justify: flex-end);
            gap: 4rem;

            .avatar {
                width: 4rem;
                height: 4rem;
                background-image: url("images/image-avatar.png");
                background-size: cover;
                background-position: center center;
                background-repeat: no-repeat;
            }

            .basket-icon-container {
                position: relative;

                .product-number {
                    height: 1.8rem;
                    width: 2.2rem;
                    border-radius: 45%;
                    background-color: $Orange;
                    @include flex-container();
                    padding: 1rem;
                    color: white;
                    font-size: 1rem;
                    padding: 0.5rem;
                    position: absolute;
                    top: -12px;
                    left: 7px;
                    visibility: hidden;
                }
            }

            .active-basket {
                visibility: visible !important;
            }
        }
    }
}

///////////////////////PRODUCT SECTION////////////////

.section-product {
    display: grid;
    grid-template-columns: 1fr 1fr;
    column-gap: 8rem;
    width: 125rem;
    margin: 3rem auto;
    padding-inline: 3rem;
    align-content: center;
    justify-items: center;
    align-items: center;
    justify-items: center;

    //////////product image///////////////
    .product-image {
        justify-self: end;
        padding-right: 0;

        .product-img-large {
            cursor: pointer;
            overflow: hidden;
            width: 100%;
            display: flex;
            justify-content: flex-end;
            margin-bottom: 2rem;

            img {
                border-radius: 12px;
                width: 48rem;
            }
        }

        .product-imgs-small {
            display: flex;
            justify-content: end;
            width: 100%;
            justify-content: end;
            gap: 1rem;

            .img-small-container {
                border-radius: 12px;
                border: 2px solid transparent;
                overflow: hidden;
                cursor: pointer;

                .img-small {
                    width: 10.9rem;
                    display: block;
                }
            }

            .img-small-container.img-small-container-active {
                border-color: $Orange;

                .img-small {
                    opacity: 0.4;
                }
            }
        }
    }

    /////////////product info
    .product-info {
        padding-inline: 3rem;
        padding-block: 0;

        .product-info-company {
            color: $Orange;
            text-transform: uppercase;
            letter-spacing: 1px;
            margin-bottom: 2rem;
            font-weight: 700;
        }

        .product-info-title {
            @include heading-font();
            margin-bottom: 3.5rem;
        }

        .product-info-description {
            line-height: 1.5;
            color: $VeryDarkBlue;
            margin-bottom: 2.5rem;
            word-spacing: 2px;
        }

        .product-info-price {
            @include flex-container($justify: flex-start);
            gap: 2rem;
            margin-bottom: 1rem;

            .sale-pice {
                @include heading-font();
                font-size: 2.8rem;
            }

            .sale-percent {
                color: $Orange;
                background-color: $PaleOrange;
                padding: 0.75rem;
                border-radius: 8px;
                display: inline-block;
                font-weight: 700;
            }
        }

        .real-price {
            color: $GrayishBlue;
            text-decoration: line-through;
            margin-bottom: 3rem;
        }

        .add-product {
            @include flex-container($justify: flex-start);
            gap: 2rem;
            padding-right: 3rem;

            .btns {
                @include flex-container();
                justify-content: space-between;
                background-color: #fffbf3;
                border-radius: 8px;
                flex-basis: 20rem;
                padding: 0.8rem;

                .btn {
                    border: none;
                    padding: 1rem;
                    color: $Orange;
                    cursor: pointer;
                    display: flex;
                    align-items: center;
                    background: none;
                }

                #product-num {
                    border: none;
                    background-color: $PaleOrange;
                    @include heading-font();
                    font-size: 1.8rem;
                    width: 6rem;
                    text-align: center;
                    background: none;
                }
            }

            .btn-add {
                background-color: $Orange;
                color: $White;
                flex-basis: 35rem;
                border: none;
                border-radius: 8px;
                padding: 1.5rem;
                font-weight: 700;
                @include flex-container();
                gap: 1rem;
                cursor: pointer;
            }
        }
    }
}

