    width: 100%;
    min-height: 125vh;
    background-color: rgba(0, 0, 0, 0.6);
    backdrop-filter: blur(3px);
    z-index: 5;
}

.hidden {
    display: none !important;
}

/////////////slider//////////////////
.slider {
    position: absolute;
    top: 50%;
    left: 50%;
    transform: translate(-50%, -50%);
    z-index: 15;
}

.product-image-slider {
    display: flex;
    flex-direction: column;
    gap: 2rem;

    .product-img-large-slider {
        width: 480px;
        display: grid;
        grid-template-columns: 1fr;
        grid-template-rows: 1fr;
        position: relative;

        .img-large-slider-container {
            width: 100%;
            grid-column: 1;
            grid-row: 1;
            cursor: pointer;

            .img-large-slider {
                width: 100%;
                border-radius: 12px;
            }
        }

        .next {
            @include btnMove();
            right: 0;
            transform: translate(50%, -50%);
            @include flex-container();
            cursor: pointer
        }

        .previous {
            @include btnMove();
            @include flex-container();
            left: 0;
            transform: translate(-50%, -50%);
            cursor: pointer;
        }

        .close {
            position: absolute;
            right: 0;
            top: -25px;
        }
    }

    .product-imgs-small-slider {
        display: flex;
        gap: 1rem;

        img {
            width: 112.5px;
            border-radius: 12px;
        }

        .img-small-container-slider {
            border-radius: 12px;
            border: 2px solid transparent;
            overflow: hidden;
            cursor: pointer;

            .img-small-slider {
                width: 10.9rem;
                display: block;
            }
        }

        .img-small-container-slider.active {
            border-color: $Orange;

            .img-small-slider {
                opacity: 0.3;
            }
        }
    }
}

//////////////cart//////////////
.cart {
    width: 35rem;
    box-shadow: 1px 4px 19px 2px rgba(0, 0, 0, 0.2);
    position: absolute;
    right: 5rem;
    top: 8rem;
    border-radius: 12px;
    z-index: 100;
    background-color: $White;

    .cart-header-container {
        padding-top: 2rem;
        padding-inline: 2rem;
        padding-bottom: 2.5rem;
        border-bottom: 1px solid #f0f1f2;

        h1 {
            font-size: 2rem;
        }
    }

    .cart-body {
        padding: 2rem;
        height: 15rem;
        @include flex-container();

        .empty {
            color: hsl(219, 9%, 45%);
            font-weight: 700;
        }

        .sneaker-info {
            display: flex;
            flex-direction: column;
            gap: 1rem;

            .total-price {
                @include flex-container($justify: space-between);
                grid-gap: 1rem;

                .final-product {
                    img {
                        width: 60px;
                        border-radius: 8px;
                    }
                }

                .sneaker-description {
                    color: $GrayishBlue;
                    line-height: 1.5;

                    .tot-price {
                        color: $Black;
                        font-weight: 700;
                        margin-left: 0.5rem;
                    }
                }
            }

            .btn-checkout {
                width: 100%;
                color: $White;
                background-color: $Orange;
                border-radius: 8px;
                border: none;
                cursor: pointer;
                padding: 1.5rem;
            }
        }
    }
}

//////////////////responsive//////////////////////
@media (max-width: 768px) {
    .section-product {
        grid-template-columns: 1fr;

        .product-image {
            visibility: hidden;
            width: 0;
        }

        .product-info {
            margin-top: 15rem;
        }
    }

    .section-product {
        width: 100%;
        padding: 0;
        margin: 0;

        .product-info {
            .product-info-company {
                font-size: 1.5rem;
            }

            .product-info-title {
                font-size: 3.5rem;
            }

            .real-price {
                float: right;
                margin-top: -3.4rem;
            }

            .add-product {
                display: block;
                padding-right: 0;

                .btns {
                    width: 100%;
                    margin-bottom: 2rem;
                }

                .btn-add {
                    width: 100%;
                }
            }
        }
    }

    .slider {
        display: block !important;
        min-width: 100%;
        top: 8rem;
        left: 0;
        transform: translate(0, 0);

        // top: 40rem;

        .product-image-slider {
            display: block;
            max-width: 100%;

            .product-img-large-slider {
                width: 100%;

                .previous {
                    left: 4.2rem;
                }

                .next {
                    right: 4.2rem;
                }

                .img-large-slider-container {
                    max-width: 100%;

                    .img-large-slider {
                        border-radius: 0;
                    }
                }
            }
        }

        .product-imgs-small-slider {
            display: none;
        }

        .close {
            display: none;
        }
    }

    header {
        padding: 1rem;

        .container-header {
            margin-top: 1rem;

            .btn-mobile-nav {
                display: block;
            }

            nav {
                .links-container {
                    // background-color: blue;
                    position: absolute;
                    top: 0;
                    left: 0;
                    width: 50%;
                    min-height: 170vh;
                    z-index: 800;
                    display: flex;
                    align-items: flex-start;
                    justify-content: flex-start;
                    padding-right: 3rem;
                    transition: all 0.5s;
                    opacity: 0;
                    pointer-events: none;
                    visibility: hidden;
                    background-color: white;

                    .links {
                        flex-direction: column;
                        gap: 4.8rem;

                        .link {
                            text-align: left;

                            .link-tag {
                                font-weight: 700;
                                color: $Black;
                                font-size: 2.4rem;
                                text-align: left;
                            }

                            .link-tag:hover::after {
                                visibility: hidden;
                                opacity: 0;
                            }
                        }
                    }
                }
            }
        }

        .container-header.nav-open {
            .links-container {
                opacity: 1;
                pointer-events: auto;
                visibility: visible;

                .links {
                    padding-left: 2rem;
                    padding-top: 10rem;
                }
            }

            .icon-mobile-nav[name="close"] {
                display: block;
                position: relative;
                z-index: 900;
                margin-left: 2rem;
            }

            .icon-mobile-nav[name="menu"] {
                display: none;
            }
        }
    }
}

